import React from 'react';
import {Link} from 'react-router-dom';
import '../css/home.css';

function LeftSmallAd(props) {
    return (
        <div className="smallad-container" style={{backgroundColor: "#FF7676", float: "left"}}>
            <div className="smallad-content">
                <div className="smallad-text">
                    <h2>{props.value.title}</h2>
                    <p>{props.value.description}</p>
                </div>
                <br />
                <Link className="ad-button" to={props.value.link}>{props.value.buttonText}</Link>
            </div>
        </div>
    );
}

function RightSmallAd(props) {
    return (
        <div className="smallad-container" style={{backgroundColor: props.value.color, float: "right"}}>
            <div className="smallad-content">
                <div className="smallad-text">
                    <h2>{props.value.title}</h2>
                    <p>{props.value.description}</p>
                </div>
                <br />
                <Link className="ad-button" to={props.value.link}>{props.value.buttonText}</Link>
            </div>
        </div>
    );
}

export {LeftSmallAd, RightSmallAd};
